const namespace = '/tet'
const socket = io.connect(location.protocol + '//' + location.hostname + ':' + '5000' + namespace)
export default {
  name: 'Online',
  data() {
    return {
      txt: 'aaaa'
    }
  },
  created() {
    let that = this;
    socket.on('connect', function() {
      socket.emit('my_event', {data: 'connect...'})
    })
    socket.on('my_response', function(msg) {
        that.txt = that.txt + msg.data;
    })
  }
}
